def create_base():
    br = ms.StatefulBrowser()

    br.open("http://agmarknet.gov.in/PriceAndArrivals/DatewiseCommodityReport.aspx")

    br.select_form('form[action="./DatewiseCommodityReport.aspx"]')

    br['ctl00$cphBody$cboYear'] = '2019'
    br['ctl00$cphBody$cboMonth'] = 'January'

    br.new_control('select', 'ctl00$cphBody$cboState', {'value': 'Chattisgarh'})
    br.new_control('select', 'ctl00$cphBody$cboCommodity', {'value': 'Ajwan'})
    br.new_control('select', 'ctl00$cphBody$cboState', {'value': 'Chattisgarh'})

    resp = br.submit_selected()

    print(br.get_url())
    print(resp.status_code)


